<script>
  const secretPassword = "Boss@psvi";
  let loggedIn = false;  // New variable to track login status

function openSecretPasswordPopup() {
  document.getElementById('secret-popup-container').style.display = 'block';
  document.getElementById('secret-form').classList.remove('hidden');
}

function closeSecretPasswordPopup() {
  document.getElementById('secret-popup-container').style.display = 'none';
}

function checkSecretPassword() {
  const enteredPassword = document.getElementById('secretPassword').value;
  if (enteredPassword === secretPassword) {
    closeSecretPasswordPopup();
    openUpdateCredentialsPopup();
  } else {
    alert('Invalid secret password.');
  }
}

function openLoginPopup() {
  document.getElementById('popup-container').style.display = 'block';
  document.getElementById('login-form').classList.remove('hidden');
  document.getElementById('update-form').classList.add('hidden');
}

function openUpdateCredentialsPopup() {
  document.getElementById('popup-container').style.display = 'block';
  document.getElementById('login-form').classList.add('hidden');
  document.getElementById('update-form').classList.remove('hidden');
}

function closePopup() {
  document.getElementById('popup-container').style.display = 'none';
}

function login() {
  var username = document.getElementById('username').value;
  var password = document.getElementById('password').value;

  if (localStorage.getItem('username') === username && localStorage.getItem('password') === password) {
      alert('Login successful!');
      document.getElementById('set-container').style.display = 'block';
      document.getElementById('login-form').style.display = 'none';
      document.getElementById('loginButton').style.display = 'none';
      document.getElementById('updateCredentialsButton').style.display = 'none';
      document.getElementById('fullfront').style.display = 'none';
      
      loggedIn = true;  // Set login status to true
      disableButtons(); 
   }
    else {
    alert('Invalid username or password.');
  }
}

function updateCredentials() {
  var newUsername = document.getElementById('newUsername').value;
  var newPassword = document.getElementById('newPassword').value;

  localStorage.setItem('username', newUsername);
  localStorage.setItem('password', newPassword);

  alert('Credentials updated successfully!');
  closePopup();
}


  </script>
